INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(1, 1, 1, 1, 2, 'Marimba (4 octaves)', 'Marimba Bergerault\r\nInstrument démontable\r\nRéglage en hauteur assisté par vérins hydropneumatiques Résonateurs aluminium - peinture epoxy bronze\r\n', 'oui?', '2020-12-30', 99.99, 'data:image/jpeg;base64,'),
(2, 4, 4, 4, 1, 'Batterie DW', 'Batterie DW en excellent état\r\nBatterie orientée ROCK\r\nCymbales fournies\r\n4 futs, 3 cymbales', 'oui', '2020-12-30', 99.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(3, 2, 18, 15, 9, 'Cor d\'harmonie', 'Cor d\'harmonie en cuivre\r\n4 palletes\r\nCor en FA/SiB\r\n\r\nProtégé par une housse de transport\r\nHuile fournie', 'oui', '2020-12-30', 10.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(4, 6, 13, 18, 11, 'Squier Bullet Strat HSS BSB', 'Body: Basswood\r\nNeck: Maple\r\nFretboard: Indian Laurel\r\n21 Medium frets\r\nScale: 648 mm\r\nNut width: 42 mm\r\nPickups: 1 humbucker (bridge) and 2 single coils (neck and middle)\r\n1-Ply white pickguard\r\n5-Way switch\r\nChrome hardware\r\nColour: Brown Sunburst', 'oui', '2021-01-07', 0.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(5, 10, 19, 22, 13, 'PRS SE P20E Parlor PB LTD', 'Edition limitée\r\nForme Tonare\r\nTable en acajou massif\r\nFond et éclisses en acajou\r\nBarrage hybride en X\r\nManche en acajou\r\nTouche en ébène\r\nRepères \"oiseaux\" PRS\r\nProfil du manche: Large/épais\r\nFilet herringbone couleur crème\r\nDiapason: 642 mm\r\nSillet de tête en os\r\n20 frettes\r\nElectronique Fishman GT-1\r\nChevalet en ébène\r\nSillet de chevalet en os\r\nMécaniques PRS\r\nCordes .012-.053\r\nCouleur: Powder Blue\r\nLivrée en housse PRS Premium', 'oui', '2021-01-07', 0.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(6, 9, 9, 6, 14, 'ES-110 B', 'Avec 88 touches lestées Responsive Hammer Compact Action (RH-C) et sons Harmonic Imagining Sound\r\n8 sons de piano + 11 autres sons comme cordes\r\nTechnologie MIDI via bluetooth\r\n192 notes polyphoniques\r\n100 styles\r\nMode double\r\n10 chansons de démonstration\r\nFonction de leçon et de transposition\r\nMétronome\r\nFonction d\'enregistrement\r\nAmortissement de la résonance\r\n2 sorties casques\r\nBluetooth 4.0\r\nSortie ligne (L / Mono, R), entrée et sortie MIDI\r\nDimensions: 1312 (P) x 286 (L) x 145 (H) mm\r\nPoids: 12 kg\r\nCouleur: noir\r\nLivré avec pédale de sustain F10H, pupitre et alimentation secteur F-350', 'oui', '2021-01-07', 0.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(7, 2, 10, 19, 10, 'YCL-457II-22 Clarinet', 'Système allemand\r\nCorps en grenadille (Dalbergia melanoxylon)\r\n22 clés\r\n6 anneaux\r\nBaril normal\r\nPlateau plat surélevé pour le trou de pouce\r\nLevier de Fa à gauche\r\nLevier de Mib à gauche\r\nDouble clé Fa/Do\r\nClé latérale Mib/Sib avec patte en métal\r\nCouplage des clés La et Sol#\r\nLiège synthétique\r\nRepose-pouce réglable avec anneau pour sangle\r\nEtui souple avec sangles sac à dos, ligature en textile BG et bec M3D incl.', 'oui', '2021-01-07', 0.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(8, 1, 3, 4, 18, 'Kalimba 17 touches', 'La Kalimba est un petit piano à pouce originaire d\'Afrique. C\'est le compagnon idéal pour vous détendre à tout moment. Il est souvent utilisé lors de séance de méditation, yoga, thérapie sonore, développement musical et à l\'occasion d\'activités extérieurs.', 'oui', '2021-01-09', 0.00, 'data:image/webp;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(9, 11, 17, 19, 17, 'Harpe 12 cordes', 'La harpe celtique à 12 cordes par Gear4music est un élégant instrument délicatement sculpté à partir de bois de hêtre sélectionné. Elle présente des ouïes pour les graves et pour les aigus qui favorisent une clarté sonore optimale, et est fournie avec un jeu de cordes de rechange et une clé d\'accordage.', 'oui', '2021-01-09', 30.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(10, 12, 11, 17, 4, 'Maracas', 'Maracas en bois. Très peu utilisés.', 'oui', '2021-01-10', 0.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(11, 6, 20, 2, 11, 'Fender Stratocaster', 'Guitare Fender Stratcaster prêtée avec son ampli et ses câbles si besoin. ', 'oui', '2021-01-10', 55.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(12, 2, 2, 3, 15, 'Violon Silencieux YVS-104', 'Violon électrique prêté avec son micro Yamaha SRT, préampli externe, écouteurs et deux câbles.\r\nUn boîtier de commande externe, dotée d’une connexion d’entrée auxiliaire peut être utilisé pour activer une réverbération d’une grande clarté. Le violon silencieux permet de jouer en casque idéal lorsque l’on souhaite jouer en toute discrétion. ', 'oui', '2021-01-10', 50.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(13, 13, 5, 20, 15, 'Violon Standard', 'Le Violon Stentor Student II est un instrument fabriqué à la main de très grande qualité, conçu pour les étudiants qui veulent un instrument avec une grande qualité sonore constante sur lequel apprendre sans se ruiner. Le corps et le manche sont tous deux en bois massif, et le violon est fourni avec un étui léger et un archet de qualité.', 'oui', '2021-01-10', 0.00, 'data:image/jpeg;base64,');
INSERT INTO `INSTRUMENT` (`INS_NUMERO`, `MAR_NUMERO`, `VIL_NUMERO`, `UTI_NUMERO`, `CAT_NUMERO`, `INS_NOM`, `INS_DESCRIPTION`, `INS_DISPONIBLE`, `IN_DATE_AJOUT`, `INS_PRIX`, `INS_PHOTO`) VALUES
(14, 6, 11, 14, 19, 'Basse Electrique', '4 cordes\r\nCustom Shop\r\nFabriquée par Jason Smith\r\nCorps en frêne sélectionné\r\nManche en érable moyennement teinté (sciage sur quartier)', 'oui', '2021-01-10', 60.00, 'data:image/jpeg;base64,'),
(15, 8, 6, 14, 10, 'Clarinette Crampon', 'Sonorité, ergonomie et fiabilité sont les qualités essentielles de la Prodige.\r\nPour la première fois sur ce segment, les opérations essentielles pour une acoustique parfaite, à savoir le moulage et l’usinage de la perce, sont entièrement réalisées en France et en Allemagne afin de garantir des dimensions constantes.\r\nLa nouvelle perce de la Prodige, inspirée du célèbre modèle E13, permet une facilité de jeu et d’émission sans précédent. Les rapports de notes sont totalement justes et équilibrés. Le pavillon a lui aussi été entièrement retravaillé afin d’optimiser la projection globale de l’instrument. L\'innovation: une perce texturée.', 'oui', '2021-01-10', 10.00, 'data:image/jpeg;base64,');

